ipetuti frequentemente, potrebbero provocare fastidiose malattie.\r\nImpara a lavorare nel modo corretto'),(202,6,'_sottotitolo_header','field_650174b9cda57'),(203,3,'title_copy','<h2>Cosa è l\'MMC</h2>\r\n<h3>sollevare o deporre un peso;\r\ntrascinare o trasportare un peso;\r\nspingere o spostare trainare un peso</h3>\r\nMovimenti sbagliati possono causare gravi problemi di salute. Il modo di ridurre il rischio c\'è. Con le giuste competenze/conoscenze/istruzioni puoi ridurre il rischio. Impara i movimenti giusti per ridurre il rischio.'),(204,3,'_title_copy','field_6501873efa0fe'),(205,3,'titolo_descrizione','Cosa è l\'MMC'),(206,3,'_titolo_descrizione','field_649030ec53fff'),(207,3,'sottotitolo_descrizione','sollevare o deporre un peso;\r\ntrascinare o trasportare un peso;\r\nspingere o spostare trainare un peso'),(208,3,'_sottotitolo_descrizione','field_64903116958a0'),(209,3,'testo_descrizione','Movimenti sbagliati possono causare gravi problemi di salute. Il modo di ridurre il rischio c\'è. Con le giuste competenze/conoscenze/istruzioni puoi ridurre il rischio. Impara i movimenti giusti per ridurre il rischio.'),(210,3,'_testo_descrizione','field_64c7b30a894fe'),(211,5,'titolo_descrizione','Lorem Ipsum'),(212,5,'_titolo_descrizione','field_649030ec53fff'),(213,5,'sottotitolo_descrizione','Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.'),(214,5,'_sottotitolo_descrizione','field_64903116958a0'),(215,5,'testo_descrizione','Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt.'),(216,5,'_testo_descrizione','field_64c7b30a894fe'),(217,4,'titolo_descrizione','Lorem Ipsum'),(218,4,'_titolo_des